import React from 'react';
import Well from '../Well';
import Text from '../Text';
import styles from './index.module.css';

const AddButton = ({text, className, ...rest}) =>
  <Well color="primary" className={className ? styles.container+" "+className : styles.container} {...rest}>
    <svg className={styles.icon} viewBox="0 0 24 24"><path d="M19 13h-6v6h-2v-6H5v-2h6V5h2v6h6v2z"/><path d="M0 0h24v24H0z" fill="none"/></svg>
    <Text color="primary">{text}</Text>
  </Well>

export default AddButton;
